import React, { useEffect, useState } from "react";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import styles from "./App.module.css";

function App() {
  const [selectedDate, setSelectedDate] = useState(new Date());
  const [brands, setBrands] = useState([]);

  useEffect(() => {
    document.getElementById("tableBody").innerHTML = null;
    fetch(`http://localhost:8000/api/getBrands`)
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        data.forEach((element) => {
          setBrands((prev) => [...prev, element]);
        });
      });
  }, [selectedDate]);

  const tableBody = brands.map((array, key) => {
    return (
      <tr key={key}>
        <td className={styles.td}>{brands.brandName}</td>
        <td className={styles.td}>{brands.numberOfProfiles}</td>
      </tr>
    );
  });

  return (
    <React.Fragment>
      <DatePicker
        selected={selectedDate}
        onChange={(date) => setSelectedDate(date)}
      />

      <table className={styles.table}>
        <thead>
          <tr>
            <td className={styles.td}>Brand Name</td>
            <td className={styles.td}>Total Profiles</td>
            <td className={styles.td}>Total Fans</td>
            <td className={styles.td}>Total Engagement</td>
          </tr>
        </thead>

        <tbody id="tableBody">{tableBody}</tbody>
      </table>
    </React.Fragment>
  );
}

export default App;
